@azkamdn Intinya Thomas Cup kerja tim, semua berperan penting mulai dr penyisihan grup sampai final. 
Ada 5 nomor kemungkinan menang/kalah selalu ada. Apalagi persaingan merata, faktor fisik &amp; mental jg berpengaruh. Alhamdulillah tim INA bisa saling back-up. Fokus final
